import * as actionType from "../actions/actionType";

const initialState = {
  message: {},
};

const message = (state = initialState, action) => {
  switch (action.type) {
    case actionType.GET_MESSAGE:
      return {
        message: action.payload,
      };

    default:
      return state;
  }
};

export default message;
